                         <div>
                          <h5>Product ID :  key= {curElm.productID} </h5>

                         </div>
                         <div>
                          <h5>Consumer Name :  key= {curElm.cos}</h5>

                         </div>

                       
                </div>

               <div>

            <Button variant="primary" onClick={() => setShow(true)}>
                                    View details
                                  </Button> 
                         
                         

               </div>

                   <div>     

<Modal
     show={show}
     onHide={() => setShow(false)}
        dialogClassName="modal-90w"
       size='xl'
