                </div>

                </div>
           



             </Modal.Body>

             <Modal.Footer>
             <div className="contact_form_button" >
                   <button  type="submit"  className="button contact_submit_button" > Confrim </button>

               </div>
             
           
              </Modal.Footer>
            </Modal> 

            </div>  





             </div>

             
             



 


          

        
   
                                



                 </section> )

       }




                                
                               


        
        

         

                 </div> 
        

        
            
        </>
    )
}

